// START OF HIGHCHART DEMO!
function show_chart() {
    var chart = new Highcharts.Chart({
        chart: {
            renderTo: 'container'
        },
        xAxis: {
            categories: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep', 'Oct', 'Nov', 'Dec']
        },
        
        series: [{
            data: [29.9, 71.5, 106.4, 129.2, 144.0, 176.0, 135.6, 148.5, 216.4, 194.1, 95.6, 54.4]        
        }]
    });
}

function add_script(scriptFile)
{
	var head = document.getElementsByTagName('head')[0];
	var script = document.createElement('script'); 
	script.setAttribute('type', 'text/javascript'); 
	script.setAttribute('src', scriptFile); 
	head.appendChild(script); 
} 

function span_to_div() 
{ 
    //alert("The CHANGEME textbox will actually change...");

    //var doc = window.frames[1][1].document; 
    var el = document.getElementsByTagName('span');

    for (var nr=0; nr<el.length; nr++) 
    { 
        if (el[nr].innerHTML == "SPAN"){ 
            el[nr].innerHTML = "DIV ADDED"; 
			var div = document.createElement("div");
			div.id = "container";
			div.setAttribute("style","width:600px");
			//div.innerHTML = "Hello";
			el[nr].appendChild(div);}
    } 
}

function show_highchart_on_ssrs()
{
	//add_script('http://ai-prd-ssrs-1/jquery.min.js');
	//add_script('http://ai-prd-ssrs-1/highcharts.js');
	span_to_div();
	show_chart();
}

show_highchart_on_ssrs();
